import React, { useEffect } from "react";
import AOS from "aos";
import "aos/dist/aos.css";

function Dfooter() {
    useEffect(() => {
        AOS.init({ duration: 900 });
        AOS.refresh();
      }, []);
    return (
    <section className="footer" data-aos="fade-up">
        <div className="dfcontainer">
            <p className="Pa">
            &#169; IEEE<br/>Made by Devang
            </p>
        </div>
    </section>
    )
}

export default Dfooter
